INSERT OR REPLACE INTO Pelicula (id_pelicula, titulo, descripcion, poster_path, backdrop_path, trailer, anio_estreno, duracion) VALUES (1159206, 'Father Mother Sister Brother', 'Tres historias separadas sobre relaciones distantes entre hijos adultos y sus padres. Cada una de las tres partes tiene lugar en la actualidad, y en un país diferente. "El Padre" está ambientado en el noreste de EE. UU., "La Madre" en Dublín, Irlanda y "La Hermana Hermano" en París, Francia. La película es una serie de estudios de personajes, tranquilos, observacionales y sin prejuicios. Una comedia, pero entretejida con hilos de melancolía.', 'https://image.tmdb.org/t/p/original/iLwZuafLq8WmM9xJjS2T9YXZvc.jpg', 'https://image.tmdb.org/t/p/original/xxFH8OgUVw5LyJmqBaXeV97mfri.jpg', '', 2025, 111);
