INSERT OR REPLACE INTO Pelicula (id_pelicula, titulo, descripcion, poster_path, backdrop_path, trailer, anio_estreno, duracion) VALUES (1317672, 'Love Me, Love Me', 'June se muda a Italia para empezar de cero tras la muerte de su hermano. En su nueva escuela de élite, se siente atraída por James, un peligroso bully involucrado en peleas clandestinas de MMA, pero comienza a salir con su mejor amigo, Will, el estudiante de honor perfecto. Sin embargo, las apariencias engañan, y June pronto descubre que nadie en su escuela es quien parece ser y todos esconden un secreto. A medida que aumenta la tensión y salen a la luz verdades ocultas, June debe decidir adónde pertenece realmente su corazón.', 'https://image.tmdb.org/t/p/original/jfwHKRHRE2X4NTexdzblaioHH51.jpg', 'https://image.tmdb.org/t/p/original/o0jRpVznKXuLvoXQX9UTKVtGjxK.jpg', '', 2026, 0);
