INSERT OR REPLACE INTO Pelicula (id_pelicula, titulo, descripcion, poster_path, backdrop_path, trailer, anio_estreno, duracion) VALUES (8740, 'Desaparecida', 'Rex y Saskia son una pareja de holandeses de vacaciones en Francia. En una gasolinera, Saskia desaparece sin dejar rastro. Rex dedica tres años de su vida a intentar encontrar a su novia sin éxito. Un día empieza a recibir postales de alguien que promete revelarle qué le pasó a Saskia. El supuesto secuestrador, un tipo llamado Raymond Lemorne, es un personaje escalofriante a quien Rex sigue la corriente en su obsesión de conocer la verdad sobre la desaparición de su amada. Y la verdad, quizá, sea más siniestra de lo que él nunca se atrevió a imaginar...', 'https://image.tmdb.org/t/p/original/6pBloz1mwz8S0gYjUao6iUoyCng.jpg', 'https://image.tmdb.org/t/p/original/gcXbxHjkUwLV4HrE2oJcbP7UGTA.jpg', '', 1988, 101);
